import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import {
  faPhone,
  faEnvelope,
  faEnvelopeOpen,
} from "@fortawesome/free-solid-svg-icons";
import { faLinkedinIn } from "@fortawesome/free-brands-svg-icons";

function Contact() {
  const icons = [faPhone, faEnvelope, faEnvelopeOpen, faLinkedinIn];
  return (
    <div className="bg-lightTone  border-2 border-black">
      <div className="max-w-screen-lg mx-auto flex flex-col items-center py-padY">
        <div className="font-racing text-5xl p-10 text-darkTone">
          Get in Touch
        </div>
        <div className="flex flex-row pb-10">
          {icons.map((icon, index) => (
            <div key={index}>
              <FontAwesomeIcon
                className="text-darkTone hover:animate-shake transition-all duration-300 p-10"
                icon={icon}
                size="2x"
              />
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

export default Contact;
